import { StyleObject } from "styletron-react";

interface VegaBrandColors {
  brandBlack: string;
  brandBlue: string;
  brandDarkBlue: string;
  brandWhite: string;
  brandYellow: string;
}

interface VegaAlertColors {
  alertGreen: string;
  alertRed: string;
  alertYellow: string;
}

interface VegaLegacyColors {
  legacyGreen: string;
  legacyRed: string;
}

interface VegaBrandBlueColors {
  brandBlue100: string;
  brandBlue200: string;
  brandBlue300: string;
  brandBlue400: string;
  brandBlue500: string;
  brandBlue600: string;
  brandBlue700: string;
  brandBlue800: string;
  brandBlue900: string;
  brandBlue1000: string;
  brandBlue1100: string;
}

interface VegaBrandYellowColors {
  brandYellow100: string;
  brandYellow200: string;
  brandYellow300: string;
  brandYellow400: string;
  brandYellow500: string;
  brandYellow600: string;
  brandYellow700: string;
  brandYellow800: string;
  brandYellow900: string;
}

interface VegaNeutralColors {
  neutral100: string;
  neutral200: string;
  neutral300: string;
  neutral400: string;
  neutral500: string;
  neutral600: string;
  neutral700: string;
  neutral800: string;
  neutral900: string;
  neutral1000: string;
  neutral1100: string;
}

interface VegaBackgroundColors {
  backgroundWhite100: string;
  backgroundWhite200: string;
  backgroundWhite300: string;
}

interface VegaAlertGreenColors {
  alertGreen100: string;
  alertGreen200: string;
  alertGreen300: string;
  alertGreen400: string;
  alertGreen500: string;
  alertGreen600: string;
  alertGreen700: string;
  alertGreen800: string;
}

interface VegaAlertYellowColors {
  alertYellow100: string;
  alertYellow200: string;
  alertYellow300: string;
  alertYellow400: string;
  alertYellow500: string;
  alertYellow600: string;
  alertYellow700: string;
  alertYellow800: string;
}

interface VegaAlertRedColors {
  alertRed100: string;
  alertRed200: string;
  alertRed300: string;
  alertRed400: string;
  alertRed500: string;
  alertRed600: string;
  alertRed700: string;
  alertRed800: string;
}

interface VegaCurrencyColors {
  coinUsd: string;
  coinBtc: string;
  coinEth: string;
  coinGusd: string;
  coinLtc: string;
  coinPax: string;
  coinPaxg: string;
  coinUsdc: string;
  coinUsdt: string;
  coinDai: string;
  coinBusd: string;
  coinLink: string;
  coinAlgo: string;
  coinUni: string;
  coinBat: string;
}

export interface VegaColors
  extends VegaBrandColors,
    VegaAlertColors,
    VegaLegacyColors,
    VegaBrandBlueColors,
    VegaBrandYellowColors,
    VegaNeutralColors,
    VegaBackgroundColors,
    VegaAlertGreenColors,
    VegaAlertYellowColors,
    VegaAlertRedColors,
    VegaCurrencyColors {
  creditCardBlack: string;
  gradientBlackBlue: string;
  transparent: string;
}

export interface VegaBorders {
  borderWidth100: StyleObject;
  borderWidth200: StyleObject;
}

export interface VegaPrimitives {
  borders: VegaBorders;
  colors: VegaColors;
}
